<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no, viewport-fit=cover">
<meta name="mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="theme-color" content="#000">
<title>NINJA TURTLES ‚Äî SEGA GENESIS ‚Äî Sega Genesis</title>
<style>
*{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent;}
html,body{width:100%;height:100%;background:#000;overflow:hidden;font-family:'Courier New',monospace;touch-action:none;}

#splash{
  position:fixed;inset:0;z-index:999;
  background:linear-gradient(180deg,#030100 0%,#050200 40%,#000a20 70%,#000 100%);
  display:flex;flex-direction:column;align-items:center;justify-content:center;gap:10px;
  overflow:hidden;
}
/* Stars */
#splash::before{
  content:'üê¢ NINJA TURTLES ¬∑ COWABUNGA ¬∑ LEO ¬∑ DONNIE ¬∑ MIKEY ¬∑ RAPH ¬∑ SHREDDER ¬∑ üê¢';
  position:absolute;top:6%;left:0;right:0;
  color:#000882;font-size:11px;letter-spacing:5px;text-align:center;
  pointer-events:none;animation:starsticker 15s linear infinite;white-space:nowrap;overflow:hidden;
}
@keyframes starsticker{from{text-indent:100%}to{text-indent:-200%}}
/* Green Hill checkers */
#splash::after{
  content:'';position:absolute;bottom:0;left:0;right:0;height:30%;pointer-events:none;
  background:linear-gradient(180deg,transparent,rgba(0,0,0,0.3));
}

.sonic-icon{font-size:60px;animation:sonicrun .3s steps(2) infinite;}
@keyframes sonicrun{0%{transform:translateX(-6px) scaleX(1)}50%{transform:translateX(6px) scaleX(-1)}}

#splash h1{
  font-size:clamp(22px,8vw,46px);
  color:#00cc44;letter-spacing:3px;
  text-shadow:0 0 20px #00cc44,0 0 40px #008822,4px 4px 0 #004411;
  text-transform:uppercase;text-align:center;line-height:1.1;
  animation:tmntglow 1.5s ease-in-out infinite;
}
@keyframes tmntglow{0%,100%{text-shadow:0 0 20px #00cc44,0 0 40px #008822,4px 4px 0 #004411}50%{text-shadow:0 0 40px #00cc44,0 0 80px #008822,4px 4px 0 #004411}}

#splash h2{font-size:clamp(28px,10vw,56px);color:#ffee88;letter-spacing:4px;text-shadow:0 0 20px #ffaa00,3px 3px 0 #885500;text-transform:uppercase;}
.rings{color:#ffee88;font-size:clamp(12px,3.5vw,18px);letter-spacing:4px;text-shadow:0 0 8px #ffaa00;animation:tmntpulse 1s ease-in-out infinite alternate;}
@keyframes tmntpulse{from{opacity:.6}to{opacity:1}}
#splash .badge{color:#002208;font-size:clamp(7px,2vw,9px);letter-spacing:2px;border:1px solid #000882;padding:5px 16px;background:rgba(0,0,0,0.7);text-align:center;}
#play-btn{padding:14px 48px;background:transparent;border:2px solid #00cc44;color:#00cc44;font-family:'Courier New',monospace;font-size:clamp(13px,3.5vw,16px);letter-spacing:4px;cursor:pointer;text-transform:uppercase;animation:glw 1.4s ease-in-out infinite;margin-top:4px;}
@keyframes glw{0%,100%{box-shadow:0 0 12px #00cc4499}50%{box-shadow:0 0 28px #00cc44ff}}
#play-btn:active{background:#00cc44;color:#000;animation:none;}

#app{display:none;flex-direction:column;width:100%;height:100%;}
#topbar{height:36px;min-height:36px;background:linear-gradient(90deg,#000,#030100,#000);border-bottom:2px solid #000882;display:flex;align-items:center;justify-content:space-between;padding:0 12px;flex-shrink:0;}
#topbar .logo{color:#00cc44;font-size:11px;letter-spacing:3px;text-shadow:0 0 8px #00cc44;}
.tbtn{background:none;border:1px solid #000882;color:#002208;font-size:15px;padding:3px 9px;cursor:pointer;border-radius:3px;}
.tbtn:active{background:#000882;color:#fff;}

#screen{flex:1;background:#000;display:flex;align-items:center;justify-content:center;position:relative;overflow:hidden;min-height:0;}
#screen::after{content:'';position:absolute;inset:0;pointer-events:none;z-index:5;background:repeating-linear-gradient(0deg,transparent,transparent 2px,rgba(0,0,0,.08) 2px,rgba(0,0,0,.08) 4px);}
#game{width:100%;height:100%;display:flex;align-items:center;justify-content:center;}
#game canvas{image-rendering:pixelated;image-rendering:crisp-edges;display:block;}

/* START button ‚Äî fixed top right inside screen */
#startBtn{
  position:absolute;top:6px;right:46px;z-index:200;
  padding:5px 14px;border-radius:6px;
  background:rgba(0,20,60,0.92);
  border:1px solid #00cc44;color:#00cc44;
  font-family:monospace;font-size:12px;letter-spacing:2px;
  cursor:pointer;touch-action:manipulation;
  -webkit-tap-highlight-color:transparent;
  text-shadow:0 0 6px #00cc44;
  box-shadow:0 0 8px #00cc4444;
}
#startBtn:active{background:#00cc44;color:#000;}

#loader{position:absolute;inset:0;z-index:10;background:radial-gradient(ellipse at center,#030100 0%,#000 100%);display:flex;flex-direction:column;align-items:center;justify-content:center;gap:14px;}
#loader .l-icon{font-size:44px;animation:sonicrun2 .3s steps(2) infinite;}
@keyframes sonicrun2{0%{transform:translateX(-8px)}50%{transform:translateX(8px)}}
#loader h2{color:#00cc44;font-size:clamp(14px,5vw,26px);letter-spacing:4px;text-shadow:0 0 16px #00cc44;text-align:center;}
#loader h3{color:#002208;font-size:clamp(9px,3vw,12px);letter-spacing:3px;}
#lbar-wrap{width:230px;height:8px;border:1px solid #000882;background:#030100;}
#lbar{height:100%;width:0%;background:linear-gradient(90deg,#008822,#00cc44,#ffee88);box-shadow:0 0 8px #00cc44;transition:width .25s;}
#lmsg{color:#001104;font-size:8px;letter-spacing:2px;}
#lerr{color:#ff4444;font-size:9px;display:none;text-align:center;max-width:280px;line-height:1.8;}
</style>
</head>

function b64ToBytes(b){const s=atob(b);const u=new Uint8Array(s.length);for(let i=0;i<s.length;i++)u[i]=s.charCodeAt(i);return u;}
function boot(){document.getElementById('splash').style.display='none';document.getElementById('app').style.display='flex';loadEmulator();}
function setProgress(p,m){document.getElementById('lbar').style.width=p+'%';document.getElementById('lmsg').textContent=m;}
function showError(m){const e=document.getElementById('lerr');e.textContent=m;e.style.display='block';setProgress(100,'ERROR');}

function ejsStart(e) {
  e.preventDefault(); e.stopPropagation();
  // Flash visual feedback
  const btn=document.getElementById('startBtn');
  btn.style.background='#00cc44'; btn.style.color='#000';
  setTimeout(()=>{btn.style.background='#00cc44';},180);

  // Method 1: gameManager direct (most reliable)
  try{ EJS_emulator.gameManager.buttonDown(0,3); setTimeout(()=>EJS_emulator.gameManager.buttonUp(0,3),150); return; }catch(e1){}
  // Method 2: module FS / input
  try{ EJS_emulator.gameManager.simulateInput(0,3,1); setTimeout(()=>EJS_emulator.gameManager.simulateInput(0,3,0),150); return; }catch(e2){}
  // Method 3: Enter key on canvas
  try{
    const cv=document.querySelector('#game canvas');
    if(cv){cv.setAttribute('tabindex','0');cv.focus();}
    document.dispatchEvent(new KeyboardEvent('keydown',{key:'Enter',keyCode:13,bubbles:true}));
    setTimeout(()=>document.dispatchEvent(new KeyboardEvent('keyup',{key:'Enter',keyCode:13,bubbles:true})),150);
  }catch(e3){}
}

function loadEmulator(){
  setProgress(10,'DECODIFICANDO ROM...');
  let rb;
  try{rb=b64ToBytes(ROM_B64);setProgress(30,'ROM OK ‚Äî '+(rb.length/1024).toFixed(0)+'KB');}
  catch(e){showError('Error: '+e.message);return;}
  const url=URL.createObjectURL(new Blob([rb],{type:'application/octet-stream'}));
  setProgress(40,'CARGANDO EMULADOR...');
  window.EJS_player='#game';
  window.EJS_core='genesis_plus_gx';
  window.EJS_gameUrl=url;
  window.EJS_gameName='TEENAGE MUTANT';
  window.EJS_color='#00cc44';
  window.EJS_backgroundColor='#000000';
  window.EJS_startOnLoaded=true;
  window.EJS_pathtodata='https://cdn.emulatorjs.org/stable/data/';
  window.EJS_VirtualGamepad=true;
  window.EJS_Buttons={gamepad:true,mute:true,settings:true,fullscreen:false,save:true,load:true,volume:true,quickSave:true,quickLoad:true,reset:true};
  window.EJS_defaultOptions={'save-state-slot':1,'video-smooth':false};
  // Genesis RetroPad: B=0,Y=1,Select=2,Start=3,Up=4,Down=5,Left=6,Right=7,A=8,X=9
  window.EJS_onLoadProgress=p=>setProgress(40+p*55,'CARGANDO CORE... '+Math.round(p*100)+'%');
  window.EJS_onGameStart=()=>{
    setProgress(100,'üê¢ GOTTA GO FAST!');
    setTimeout(()=>{
      document.getElementById('loader').style.display='none';
      // Focus canvas so keyboard events work
      const cv=document.querySelector('#game canvas');
      if(cv){cv.setAttribute('tabindex','0');cv.focus();}
    },600);
  };
  const s=document.createElement('script');s.src='https://cdn.emulatorjs.org/stable/data/loader.js';
  s.onerror=()=>{const s2=document.createElement('script');s2.src='https://cdn.jsdelivr.net/npm/emulatorjs@latest/data/loader.js';document.head.appendChild(s2);};
  document.head.appendChild(s);
  let f=40;const iv=setInterval(()=>{if(document.getElementById('loader').style.display==='none'){clearInterval(iv);return;}f=Math.min(f+1,94);if(f<94)setProgress(f,'CARGANDO...');},300);
}

function toggleFS(){if(!document.fullscreenElement){document.documentElement.requestFullscreen({navigationUI:'hide'}).catch(()=>{});if(screen.orientation?.lock)screen.orientation.lock('landscape').catch(()=>{});}else document.exitFullscreen?.();}
let muted=false;
function toggleMute(){muted=!muted;document.getElementById('muteBtn').textContent=muted?'üîá':'üîä';if(window.EJS_emulator?.setVolume)EJS_emulator.setVolume(muted?0:1);document.querySelectorAll('audio,video').forEach(a=>a.muted=muted);}
document.addEventListener('touchmove',e=>{if(e.touches.length>1)e.preventDefault();},{passive:false});
document.addEventListener('gesturestart',e=>e.preventDefault(),{passive:false});
</script>
